DELIMITER $$
--
-- Procedure
--
CREATE DEFINER=`` PROCEDURE `add_abbonamento` (IN `data_inizio_a` DATE, IN `cf_utente_a` CHAR(16), IN `n_carta_a` CHAR(16))  BEGIN

INSERT INTO Abbonamenti(data_inizio ,cf_utente ,n_carta) VALUES (data_inizio_a ,cf_utente_a ,n_carta_a);
UPDATE Abbonamenti
SET data_scadenza = date_add(data_inizio_a ,interval 60 day)
WHERE id_abbonamento = (SELECT max(id_abbonamento) FROM Abbonamenti);

IF (CURRENT_DATE < (SELECT data_scadenza FROM abbonamenti WHERE id_abbonamento = (SELECT
MAX(id_abbonamento) FROM abbonamenti)))
THEN
UPDATE abbonamenti SET stato = 'Attivo' WHERE id_abbonamento = (SELECT MAX(id_abbonamento) FROM abbonamenti);
UPDATE abbonamenti
SET giorni_rimanenti = DATEDIFF(data_scadenza, CURRENT_DATE)
WHERE id_abbonamento = (SELECT MAX(id_abbonamento)FROM  abbonamenti);
ELSE
UPDATE abbonamenti SET stato = 'Scaduto' WHERE id_abbonamento = (SELECT MAX(id_abbonamento) FROM abbonamenti);
END IF;
END$$

CREATE DEFINER=`` PROCEDURE `daily_set` ()  BEGIN
	UPDATE abbonamenti
    SET giorni_rimanenti = giorni_rimanenti -1
    WHERE stato = 'Attivo';
    UPDATE abbonamenti
    SET stato = 'Scaduto'
    WHERE giorni_rimanenti = 0;
    UPDATE users 
    SET tipo = 'Standard'
    WHERE cf = (SELECT cf_utente FROM abbonamenti WHERE giorni_rimanenti = 0);
    UPDATE abbonamenti
    SET giorni_rimanenti = NULL
    WHERE giorni_rimanenti = 0;
END$$

CREATE DEFINER=`` PROCEDURE `show_abb` ()  BEGIN
SELECT u.nome, u.cognome,
a.id_abbonamento, a.stato
from abbonamenti a join users u on a.cf_utente = u.cf
order by (stato);
END$$

CREATE DEFINER=`` PROCEDURE `show_alb_mus` ()  BEGIN 
SELECT nome_musicista, strumento
FROM formazioni
WHERE nome_album = ins_alb
GROUP BY (nome_musicista);
END$$

CREATE DEFINER=`` PROCEDURE `show_downloads_standard` ()  BEGIN
SELECT u.nome, u.cognome, d.data_ora, s.titolo_traccia, s.strumento, s.albumfrom FROM (users AS u join downloads AS d on u.cf = d.cf_utente) join solos AS s ON s.id_solo = d.id_solo
WHERE tipo = 'Standard'
ORDER BY (data_ora) ASC;
END$$

CREATE DEFINER=`` PROCEDURE `show_user_dmax` ()  BEGIN
SELECT nome, cognome, n_downloads
from users
where n_downloads = (SELECT MAX(n_downloads) FROM users);
END$$

DELIMITER ;

