DELIMITER $$
CREATE TRIGGER `tr_carta_scaduta` BEFORE INSERT ON `abbonamenti` FOR EACH ROW add_abbonamento:BEGIN
IF NEW.data_inizio >
    (SELECT data_scadenza_carta
     FROM metodipagamento
     WHERE (NEW.n_carta = n_carta))
THEN  SIGNAL SQLSTATE '45000'
       SET MESSAGE_TEXT = 'La carta con la quale si sta cercando di pagare l''abbonamento è scaduta';
       END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_check_abbonamento` BEFORE INSERT ON `abbonamenti` FOR EACH ROW add_abbonamento:BEGIN
IF EXISTS(SELECT stato FROM abbonamenti WHERE cf_utente = NEW.cf_utente AND stato = 'Attivo')
       THEN
       SIGNAL SQLSTATE '45000'
       SET MESSAGE_TEXT = 'Esiste già un abbonamento attivo per questo utente.';
       END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_set_tipo` AFTER INSERT ON `abbonamenti` FOR EACH ROW add_abbonamento:BEGIN
UPDATE users
SET tipo = 'Premium'
WHERE NEW.cf_utente = cf;
END
$$
