DELIMITER $$
CREATE TRIGGER `rep_downloads` BEFORE INSERT ON `downloads` FOR EACH ROW BEGIN
IF EXISTS (select id_solo from downloads
WHERE id_solo = NEW.id_solo AND cf_utente = NEW.cf_utente)
THEN
SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Questo utente ha già scaricato questo brano!';
END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tr_limite_downloads` BEFORE INSERT ON `downloads` FOR EACH ROW BEGIN
  CASE 
    WHEN (SELECT tipo FROM users WHERE cf = NEW.cf_utente) = 'Premium' THEN
      UPDATE users 
      SET n_downloads = n_downloads + 1 
      WHERE cf = NEW.cf_utente;
  ELSE
    CASE
      WHEN (SELECT n_downloads FROM users WHERE cf = NEW.cf_utente)<=5 THEN
        UPDATE users 
        SET n_downloads = n_downloads + 1 
        WHERE cf = NEW.cf_utente;
      ELSE
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Limite di download gratuiti per utente standard superato. Impossibile proseguire.';
    END CASE;
  END CASE;
END
$$
DELIMITER ;
